void drawBumber() {
    clear_screen(); 
    if (initializeFirst == TRUE) {
        initializePlayer1();
        initializeMap();
        if (gameState == TWOP) {
            // initialize player 2
            initializePlayer2();
        }

        initializeFirst = FALSE;
    }
    // 304 by 240
    for (int i = 0; i < GAME_RESOLUTION_X; i += BLOCK_WIDTH) {
        for (int j = 0; j < GAME_RESOLUTION_Y; j+= BLOCK_WIDTH) {
            drawBlock(i, j, mapArray[i / BLOCK_WIDTH][j / BLOCK_WIDTH]);
        }
    }
    drawPlayer(p1); 
    if (gameState == TWOP) drawPlayer(p2);
}

void initializeMap() {
    // everything is grass by default, so we should just add in blocks
    // 
    // initialize borders to be stone
    for (int i = 0; i < BLOCK_RES_X; i++) {
        mapArray[i][0] = STONE;
        mapArray[i][BLOCK_RES_Y - 1] = STONE;
    }
    for (int j = 0; j < BLOCK_RES_Y; j++) {
        mapArray[0][j] = STONE;
        mapArray[BLOCK_RES_X - 1][j] = STONE;
    }    
    for (int i = 2; i < BLOCK_RES_X - 1; i+= 2) {
        for (int j = 2; j < BLOCK_RES_Y - 1; j+= 2) {
            mapArray[i][j] = STONE;
        } 
    }    

    // add the bricks
    srand(time(NULL));
    for (int i = 1; i < BLOCK_RES_X - 1;  i++){
        for (int j = 1; j < BLOCK_RES_Y - 1; j++) {
            // don't draw bricks if it is the starting 3 squares for player of if it is a wall
            if (mapArray[i][j] == STONE || (i == 1 && j == 1) || (i == 1 && j == 2) || (i == 2 && j == 1)  
                || (i == BLOCK_RES_X - 2 && j == BLOCK_RES_Y - 2) || (i == BLOCK_RES_X - 3 && j == BLOCK_RES_Y - 2) || (i == BLOCK_RES_X - 2 && j == BLOCK_RES_Y - 3))
                continue;
            else {
                // randomly draw a brick. 1 in 15 chance of being blank. 
                int num = rand()%15; 
                if (num % 14 == 0) {
                    continue;
                } else {
                    mapArray[i][j] = BRICK; 
                }
            }
        }
    }
    // make the edges of player spawn a brick
    // top left
    mapArray[3][1] = BRICK;
    mapArray[1][3] = BRICK;

    // bottom right;
    mapArray[GAME_RESOLUTION_X - 4][GAME_RESOLUTION_Y - 1] = BRICK;
    mapArray[GAME_RESOLUTION_X - 1][GAME_RESOLUTION_Y - 4] = BRICK;
}

void keyboard_input() {
    volatile int *PS2 = (int *) PS2_BASE;
    
    int i = 0;
    // reads multiple inputs, maxInterrupt
    while (*PS2 & 0x8000) {
        keyInterrupts[i] = (*PS2 & 0xFF);
        i++;
    }
    // to clear out the rest 
    for (int j = i; j < maxInterrupt; j++) {
        keyInterrupts[j] = 0x0;
    }

    return;
}

int main(void) {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    
    // declare other variables(not shown)


    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    while (1)
    {
        /* Erase any boxes and lines that were drawn in the last iteration */
        clear_screen(); //for now
        
        
        switch (gameState) { // swtich looks better than too many if elses
            case HOME:
                drawHome();
                break;
            case ONEP:
                keyboard_input();
                for (int i = 0; i < maxInterrupt; i++) {
                    if (keyInterrupts[i] == 0x29) {
                        gameState = TWOP;
                        initializeFirst = TRUE;
                    }
                    else if (keyInterrupts[i] == 0) break;
                }
                drawBumber();
                break;
            case TWOP:
                keyboard_input();
                drawBumber();
                break;
            case OVER:
                break;
        }
         // commented out to not mess with drawing code for now
        
        /*
        if (gameOver) {

        }
        else if (multiPlayer == 1) {
            drawBumber();
        } else
            drawHome(); 
        */
        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}